from sympy import isprime
def aupton(terms):
    alst, aset = [], set()
    for n in range(1, terms+1):
        ending = 2*n - 1 + (n+1)//4 * 2 # A045572
        i, pow10 = ending, 10**len(str(ending))
        while i in aset or not isprime(i): i += pow10
        alst.append(i); aset.add(i)
    return alst
